import React from "react";
import "../styles/Presentacion.css";

const Presentacion = () => {
  return (
    <section className="presentacion">
      <div className="presentacion-contenido">
        <h1>Hola, soy Andrey Gaviria</h1>
        <p>
          Desarrollador de software con pasión por crear soluciones innovadoras.
          Este portafolio refleja mi experiencia, habilidades y proyectos.
        </p>
      </div>
      <div className="presentacion-imagen">
        {/* Aquí podrías incluir una imagen temática o un ícono */}
        <img
          src="https://via.placeholder.com/150" 
          alt="Representación marina"
        />
      </div>
    </section>
  );
};

export default Presentacion;
